import React from "react"
class App extends React.Component{
           constructor(props){
            super(props)
                this.state={
                  fullanme:"",
                  email:"",
                  password:"",
                  cpassword:"",

                }
            
           }
           changefullname=(e)=>{
            this.setState({
                fullanme:e.target.value

                
            })
           }
           changeemail=(e)=>{
            this.setState({
                email:e.target.value
            })
           }
           changepass=(e)=>{
            this.setState({
                password:e.target.value
            })
            }
        
           changeconfipass=(e)=>{
            this.setState({
                confimpassword:e.target.value
            })

           }

        render(){
            return(

                <div>
                <form>
                   <h2>sign up</h2>
                   <br></br>
                   <label>FULL NAME:</label>
                   <input value={this.state.fullname}type="text" onChange={this.changefullname}/>
                   <br></br><br></br>
                   <label>EMAIL:</label>
                   <input value={this.state.email}type="email" onChange={this.changeemail}/>
                   <br></br><br></br>
                   <label>PASSWORD:</label>
                   <input value={this.state.password}type="password" onChange={this.changepass}/>
                   <br></br><br></br>
                   <label>CONFIRM PASSWORD:</label>
                   <input value={this.state.cpassword}type="password"onChange={this.changeconfipass}/>
                    <br></br><br></br>
                    <input type="submit" value="SIGN UP"/>

                      </form>

                      <form>
                   <h2>login</h2>
                   <br></br>
                   <label>FULL NAME:</label>
                   <input type="text"/>
                   <br></br><br></br>
                   <label>EMAIL:</label>
                   <input type="email"/>
                   <br></br><br></br>
                   <label>PASSWORD:</label>
                   <input type="password"/>
                   <br></br><br></br>
                   <label>CONFIRM PASSWORD:</label>
                   <input type="password"/>
                    <br></br><br></br>
                    <input type="submit" value="LOGIN"/>

                      </form>




                </div>







            )
        }
    }

        
    

export default App;
